window.bookSummaryJSON = "<p><b>Thirty floors of nightmare fueled action. An ex-cop with nothing left to lose.</b></p> <p>After losing his job and family, Flint Reed finds himself in the middle of a terrorist attack. With nothing but his wits and experience as a former Union police officer, he must do everything he can to stay alive.</p> <p>As he soon discovers, however, there are also hostages, and no one is coming to save them.</p> <p>All hope falls to Flint.</p> <p>But as he fights to navigate the building, the real answers begin to unravel. What are the terrorists really after, and why are they so intent on getting into the vault?</p> <p>Experience the beginning of the Resonant Son series. If you're a fan of <i>Die Hard</i>, <i>Renegade Star</i>, or the <i>Last Reaper</i>, you'll love this epic sci-fi thrill ride.</p>"; 
